import React, { Component } from 'react';
import loslagos_1 from './img/loslagos_1.png';
import loslagos_2 from './img/loslagos_2.png';

class Home extends Component{

    state = { clicked: false }

    handleClick = () => {
        this.setState({ clicked: !this.state.clicked })
    }
    render() {
        return (
            <div className='/'>
                <img src={loslagos_1}
                    onMouseOver={loslagos_2}
                    onMouseOut={loslagos_1}
                />
             
            </div>
        );
    }

}

export default Home;
